============

1️⃣ Learning to Lead: The Journey to Leading Yourself, Leading Others, and Leading an Organization por Ron Williams con Karl Weber  Este libro es para lectores que comienzan sus carreras y luchan por seguir el camino correcto hacia el liderazgo.

