4️⃣ Developing the Leader Within You 2.0 and Leadershift  por John C. Maxwell\ No importa cual es tu entorno, empresa, organización sin fines de lucro, los principios de liderazgo influirán positivamente en tu vida.

5️⃣ The Infinite Game por Simon Sinek  Este libro busca que los líderes que adoptan una mentalidad infinita crean organizaciones más fuertes, más innovadoras e inspiradoras.

